import ListingView from '../pages/ListingView';
import Register from '../pages/Register';
import Search from '../pages/Search';

const routes = [
    {
        path: '/search',
        component: Search,
        exact: true
    },
    {
        path: '/listing',
        component: ListingView,
        exact: true
    },
    {
        path: '/register',
        component: Register,
        exact: true
    }
];

export default routes;
